import React from "react";
import { Card, Image } from "semantic-ui-react";

const CardExampleCard = () => (
  <Card>
    <Image
      src="/code game screen shot.png"
      wrapped
      ui={false}
    />
    <Card.Content>
      <Card.Header>Project</Card.Header>
      <Card.Meta>
        <span className="date"></span>
      </Card.Meta>
      <Card.Description>
        Description
      </Card.Description>
    </Card.Content>
    <Card.Content extra>

    </Card.Content>
  </Card>
);

export default CardExampleCard;
